text = ""
text2 = ""
text3 = ""

def frequency(text):
    letterCount = {}

    for i in range(65, 91):
        letterCount[chr(i)] = 0

    for i in text:
        letterCount[i] += 1

    return letterCount

def coincidence(text: str, num: int):

    letterCount = frequency(text)

    coincidenceIndex = sum([x*(x-1) for x in letterCount.values()])/(len(text)*(len(text)-1))
    print(f"Text {num} has IC: {coincidenceIndex*100}%")

sortedDict = [x[0] for x in sorted(frequency(text3).items(), key=lambda x:x[1], reverse=True)]
print("".join(sortedDict))

coincidence(text, 1)
coincidence(text2, 2)
coincidence(text3, 3)